import { useSelector } from "react-redux";

const UserList = () => {
  const users = useSelector((state) => state.users);

  return (    
    <div>
      {users.map(({ nome, email, dataDeNascimento, cpf}, i) => (
        <div key={i}>
          <p>{nome}</p>
          <p>{email}</p>
          <p>{dataDeNascimento}</p>
          <p>{cpf}</p>

          <button>Delete</button>
          <button>Edit</button>                
        </div>
            ))}
      </div>
  )
}

export default UserList;
